INSERT INTO `reportes` (`id`, `empresa_id`, `nombre_de_reporte`, `rtf_cuerpo`, `created_at`, `updated_at`) VALUES
(1, 1, 'Solicitud de Fabricacion - hoja 1', '<h1 style="text-align:center"><u>Solicitud de Fabricaci&oacute;n</u></h1><p>El Sr. (cliente_id)cliente_apellido cliente_nombre, titular del cliente_tipo_de_documento cliente_nro_de_documento&nbsp;domiciliado en calle cliente_domicilio de la ciudad/localidad de cliente_localidad&nbsp;Pcia. de cliente_provincia expresa que habiendo&nbsp; sido informado ampliamente sobre los modelos, caracter&iacute;sticas, precios y formas de pago de las viviendas que fabrica Viviendas Tecnohouse de Sistema de Viviendas Tecnohogar SRL., con domicilio en calle Marcos Ciani 3305 de la ciudad de Venado Tuerto, provincia de Santa Fe, presenta formalmente la mencionada empresa fabricante la solicitud de fabricaci&oacute;n de una vivienda industrializada TECNOHOUSE la que deber&aacute; responder a los requisitos que seguidamente se expresan:</p><h3 style="text-align:center"><u>PRIMERA</u></h3><p>OBJETO SOLICITADO: Se solicita la fabricaci&oacute;n de los elementos constitutivos de una vivienda industrializada TECNOHOUSE modelo solicitud_modelo&nbsp;/ solicitud_total_de_metros_cuadrados mts2 INTERNOS, la que consta de solicitud_total_de_metros_cuadrados mts2, cuyos ambientes , distribuci&oacute;n y medidas son las siguientes:</p><p>solicitud_componentes</p><h3 style="text-align:center"><u>SEGUNDA</u></h3><p style="text-align:justify">PRECIO: El valor total de la vivienda solicitada asciende a la suma de solicitud_suma_total, suma que el solicitante ofrece pagar de&nbsp; la siguiente forma:</p><p>UN ANTICIPO de solicitud_anticipo, el saldo de solicitud_resto se abonar&aacute; contra entrega de la vivienda solicitada. Para el caso de optar el solicitante de pagar el saldo en cuotas mensuales, dicha opci&oacute;n solo ser&aacute; procedente cuando: a) se haya abonado la totalidad del anticipo en la forma pactada y b) presente el solicitante las garant&iacute;as necesarias a satisfacci&oacute;n pura y exclusiva de la parte locadora.</p><h3 style="text-align:center"><u>TERCERA</u></h3><p>ENTREGA: El solicitante recibir&aacute; la vivienda objeto de la presente solicitud a los sesenta d&iacute;as corridos desde la cancelaci&oacute;n del anticipo y una vez cumplidos los siguientes requisitos:</p><ol>	<li>cancelaci&oacute;n del saldo del precio</li>	<li>para el caso de haber optado por el pago del saldo en cuotas, una vez cumplimentados los requisitos enunciados en la cl&aacute;usula anterior sobre el particular.</li></ol><h3 style="text-align:center"><u>CUARTA</u></h3><p>El solicitante se obliga a la firma del contrato definitivo que reglar&aacute; la totalidad de los derechos y obligaciones de las partes dentro del plazo de quince d&iacute;as corridos de aceptada la presente solicitud.&nbsp;&nbsp; La falta de celebraci&oacute;n del citado contrato dentro del plazo establecido, implicar&aacute; el desistimiento por parte del solicitante quien perder&aacute; la suma entregada en concepto de se&ntilde;a.</p>', '2018-12-17 13:59:03', '2018-12-19 19:38:22'),
(2, 1, 'Solicitud de Fabricacion - hoja 2', '<h1 style="text-align:center"><u>Solicitud de Fabricaci&oacute;n</u></h1>\r\n\r\n<p>El Sr. (cliente_id)cliente_apellido cliente_nombre, titular del cliente_tipo_de_documento cliente_nro_de_documento&nbsp;domiciliado en calle cliente_domicilio de la ciudad/localidad de cliente_localidad&nbsp;Pcia. de cliente_provincia expresa que habiendo&nbsp; sido informado ampliamente sobre los modelos, caracter&iacute;sticas, precios y formas de pago de las viviendas que fabrica Viviendas Tecnohouse de Sistema de Viviendas Tecnohogar SRL., con domicilio en calle Marcos Ciani 3305 de la ciudad de Venado Tuerto, provincia de Santa Fe, presenta formalmente la mencionada empresa fabricante la solicitud de fabricaci&oacute;n de una vivienda industrializada TECNOHOUSE la que deber&aacute; responder a los requisitos que seguidamente se expresan:</p>\r\n\r\n<h3 style="text-align:center"><u>PRIMERA</u></h3>\r\n\r\n<p>OBJETO SOLICITADO: Se solicita la fabricaci&oacute;n de los elementos constitutivos de una vivienda industrializada TECNOHOUSE modelo solicitud_modelo&nbsp;/ solicitud_total_de_metros_cuadrados mts2 INTERNOS, la que consta de solicitud_total_de_metros_cuadrados mts2, cuyos ambientes , distribuci&oacute;n y medidas son las siguientes:</p>\r\n\r\n<h3 style="text-align:center"><u>QUINTA</u></h3>\r\n\r\n<p style="text-align:justify">DE LA ACEPTACI&Oacute;N: Se considerar&aacute; que el fabricante ha aceptado la solicitud cursada si dentro del plazo de diez d&iacute;as corridos de haber sido cursada la misma no ha sido&nbsp; rechazada&nbsp; fehacientemente.&nbsp; La presente solicitud es efectuada en el domicilio de Sistema Tecnohogar SRL, sito en calle Iraola 925</p>\r\n\r\n<p style="text-align:justify">- Parque Industrial La Victoria de la ciudad de Venado Tuerto a los&nbsp; solicitud_dia&nbsp; d&iacute;as del mes de solicitud_mes del a&ntilde;o solicitud_anio.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>RECIBE POR SISTEMA TECNOHOUSE:</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>FIRMA EMPLEADO:</p>\r\n			</td>\r\n			<td>\r\n			<p>FIRMA DEL SOLICITANTE:</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>..........................................................................</td>\r\n			<td>..........................................................................</td>\r\n		</tr>\r\n		<tr>\r\n			<td>ACLARACI&Oacute;N:</td>\r\n			<td>ACLARACI&Oacute;N:</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>..........................................................................</p>\r\n			</td>\r\n			<td>..........................................................................</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>', '2018-12-19 19:38:45', '2018-12-19 19:38:45');

